import { useEffect } from "react";

export default function PokemonBasic({ p }) {
  useEffect(() => {
    console.log(p);
  }, [p]);

  const BasicInfo = (key, value) => <p><span>{key}</span> {value}</p>;

  return (
    <div>
      <p className="p-name">{p.pokemonId}</p>
      <p>
        <span>Role:</span> {p.role}
      </p>
      <BasicInfo key={"Role"} value={p.role}/>
    </div>
  );
}
